CortanaConsentPanel.Description:
Selleks et Cortana saaks su küsimustele vastata, aidata sul olulist meeles pidada ja palju muud teha, luba Cortanal koguda ja kasutada oma teavet, sealhulgas järgmist:

asukoht ja asukohtade ajalugu;

kontaktid, kalendri üksikasjad, sõnumite, kiirsõnumite ja rakenduste sisu ning suhtlusajalugu;

otsinguajalugu ja muu seadmes olev teave, mille abil saab sinu kogemuse isiklikumaks muuta
